!function(){Template.__checkName("aboutEdgenet"),Template.aboutEdgenet=new Template("Template.aboutEdgenet",function(){var e=this;return HTML.Raw('<div class="edgenet chapter">\n  <div class="container-fluid">\n    <h1 class="chapter-title text-center shadow">A <a href="http://gounplugged.co/hack">grassroots community</a> is already working on a solution.</h1>\n    <h4 class="text-center shadow"><a href="http://theedg.es">The Edgenet</a> will be an open network, owned by the users...<br>\n    and Unplugged is developping the first applications that connect to it.</h4>\n  </div>\n</div>')})}();

!function(){Template.__checkName("aboutEnd"),Template.aboutEnd=new Template("Template.aboutEnd",function(){var e=this;return HTML.Raw('<div class="end-note chapter">\n  <div class="container-fluid">\n    <div class="row chapter-title">\n      <img src="unplugged.png" class="center-block img-responsive" alt="Unplugged">\n      <h2 class="text-center end-text">Coming Soon.</h2>\n    </div>\n  </div>\n</div>')})}();

!function(){Template.__checkName("aboutExpansion"),Template.aboutExpansion=new Template("Template.aboutExpansion",function(){var e=this;return HTML.Raw('<div class="expansion chapter">\n  <div class="container-fluid">\n    <h1 class="chapter-title text-center shadow">As the network grows, neighborhoods will combine strengths.</h1>\n    <h4 class="text-center shadow">Working together, we will connect the world.</h4>\n  </div>\n</div>')})}();

!function(){Template.__checkName("aboutNotOurs"),Template.aboutNotOurs=new Template("Template.aboutNotOurs",function(){var t=this;return HTML.Raw('<div class="not-ours chapter">\n  <div class="container-fluid">\n    <h1 class="text-center chapter-title">The Internet isn\'t ours.</h1>\n    <img src="not-ours/not-ours.png" class="center-block img-responsive" alt="The entities in control">\n    <div class="row not-ours-explanation">\n      <div class="col-sm-12 col-md-6 col-md-offset-3">\n        <p class="text-center not-ours-explanation-text">\n        These imperfections are a result of such rapid consolidation that today just a few big players own most of the infrasture we use to communicate online.\n        </p>\n      </div>\n    </div>\n  </div>\n</div>')})}();

!function(){Template.__checkName("aboutNotPerfect"),Template.aboutNotPerfect=new Template("Template.aboutNotPerfect",function(){var e=this;return HTML.Raw('<div class="not-perfect chapter">\n  <div class="container-fluid">\n    <h1 class="text-center chapter-title">But nothing is perfect.</h1>\n    <div class="row">\n      <div class="col-md-10 col-md-offset-1 col-sm-12">\n        <div class="row">\n          <div class="col-sm-12 col-md-2 col-md-offset-2">\n            <img src="not-perfect/not-perfect-privacy.png" class="center-block img-responsive" alt="Privacy">\n            <h2 class="text-center">Privacy</h2>\n            <p class="text-center">Your boss knows what you\'re up to.</p>\n          </div>\n          <div class="col-sm-12 col-md-2 col-md-offset-1">\n            <img src="not-perfect/not-perfect-spying.png" class="center-block img-responsive" alt="Spying and hacking">\n            <h2 class="text-center">Spying - Hacking</h2>\n            <p class="text-center">So does your country.</p>\n          </div>\n          <div class="col-sm-12 col-md-2 col-md-offset-1">\n            <img src="not-perfect/not-perfect-cost.png" class="center-block img-responsive" alt="Cost">\n            <h2 class="text-center">Cost</h2>\n            <p class="text-center">The average phone bill is over $100.</p>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>')})}();

!function(){Template.__checkName("aboutSocial"),Template.aboutSocial=new Template("Template.aboutSocial",function(){var e=this;return HTML.Raw('<div class="social chapter">\n  <div class="container-fluid">\n    <div class="row">\n      <div class="col-md-8 col-md-offset-2 col-sm-12">\n        <h1 class="text-center chapter-title">\n            We believe that this evolution will lead to societies that are connected, collective, and compassionate.\n        </h1>\n\n        <div class="row chapter">\n          <div class="col-md-6 col-sm-12">\n            <img src="social/social-disaster.png" class="center-block img-responsive" alt="Disaster response">\n            <h2 class="text-center">Disaster Response</h2>\n            <p class="text-center">\n                Requiring no central infrastructure, even the most devastated regions will remain connected when it matters most.\n            </p>\n          </div>\n          <div class="col-md-6 col-sm-12">\n            <img src="social/social-access.png" class="center-block img-responsive" alt="Universal access">\n            <h2 class="text-center">Universal Access</h2>\n            <p class="text-center">\n                By reducing setup costs, the over 4 billion people without internet will have access to a better option.\n            </p>\n          </div>\n        </div>\n        <div class="row">\n          <div class="col-md-6 col-md-offset-3 col-sm-12">\n            <img src="social/social-ownership.png" class="center-block img-responsive" alt="Collective ownership">\n            <h2 class="text-center">Collective Ownership</h2>\n            <p class="text-center">\n                Because people own the infrastructure, it becomes impossible for a single authority to censor, monitor, or restrict access to the Edgenet.\n            </p>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>')})}();

