!function(){Template.__checkName("research"),Template.research=new Template("Template.research",function(){var e=this;return[HTML.Raw('<div class="chapter">\n  <div class="container">\n    <div class="row">\n      <div class="col-sm-5">\n        <img src="/research/research.jpg" class="img-responsive img-rounded secondline-image" alt="SecondLine">\n      </div>\n      <div class="col-sm-7">\n        <h3>Research Projects</h3><br>\n        <p>Technology has can be a powerful tool for equity and social justice. However, in its current state, technological development largely ossifies pre-existing structural inequity. Exploring the radical potential of technology is the motivation for Unplugged’s Research Program.</p><br>\n        <p>We are deeply excited to explore research that recognizes and focuses on processes, rather than products, as the true locus of creativity and development, and believe shifting our focus to processes will have a revolutionary impact on the humaneness of economic development.</p>\n      </div>\n    </div>\n  </div>\n</div>\n'),HTML.DIV({"class":"chapter-title"},"\n  ",HTML.DIV({"class":"container"},"\n    ",Blaze._TemplateWith(function(){return{buttonText:Spacebars.call("Keep me updated.")}},function(){return Spacebars.include(e.lookupTemplate("signupEmail"))}),"\n  "),"\n"),HTML.Raw('\n<div class="chapter">\n  <div class="container">\n    <h1>Stingray Usage</h1>\n    <p>Those at the fringes of society are often the first to be affected by aggressive policing tactics. In this project, we seek to better understand how low income and minority populations may be disproportionately targeted by a form of surveillance called Stingrays.</p>\n    <p><a href="https://www.aclu.org/issues/privacy-technology/surveillance-technologies/stingray-tracking-devices">Stingrays aka IMSI catchers,</a> are devices that effectively imitate cell phone towers and are used by law enforcement to track  the location call history, and even content of individuals’ cell phones. Furthermore, Stingrays  pick up information from all phones in range of the device, not just the phone they’re targeting.These devices are clouded in secrecy. Given recent revelations concerning law enforcement in America, this project is an effort to shed light on their use.</p>\n    <p>This is done using a modified version of an <a href="https://github.com/SecUpwN/Android-IMSI-Catcher-Detector">Android application</a> that analyzes known cell tower locations, signal strength, and other variables in order to inform users whether it is likely their device is in range of a Stingray. Our <a href="https://github.com/marvinmarnold/Android-IMSI-Catcher-Detector">modified version</a> of the application uploads anonymous data so that we can map threats and better understand Stingray use within low-income communities and communities of color.</p>\n    <p><b>WARNING: THIS PROJECT IS HIGHLY EXPERIMENTAL AND STILL AT BLEEDING ALPHA!</b></p>\n  </div>\n</div>\n'),Spacebars.include(e.lookupTemplate("stingray"))]})}();

