!function(){Template.__checkName("secondLine"),Template.secondLine=new Template("Template.secondLine",function(){var n=this;return[HTML.Raw('<div class="chapter">\n  <div class="container">\n    <div class="row">\n      <div class="col-sm-5">\n        <img src="/secondline/secondline.jpg" class="img-responsive img-rounded secondline-image" alt="SecondLine">\n      </div>\n      <div class="col-sm-7">\n        <h3>Second Line</h3><br>\n        <p>Maybe you’ve heard that your online activity <a href="http://www.businessinsider.com/linkedin-users-are-over-twice-as-likely-to-report-identity-theft-2012-3">increases your vulnerability</a> to identity theft, that the government is <a href="http://www.slate.com/blogs/future_tense/2015/05/06/report_government_surveillance_planes_spotted_over_baltimore_protests.html">tracking supporters</a> of the #BlackLivesMatter movement, or that the NSA is looking at your <a href="http://www.salon.com/2015/04/09/dick_pics_for_freedom_how_john_oliver_accidentally_started_a_nsfw_revolution/">dick picks</a>, but think the tools that can protect you are too complicated.</p><br>\n        <p>If so, Second Line is the messaging app for you. Just download, pick a password, and you’ll be able to send messages so that even the phone company won’t know who you\'re talking to or what you are saying.</p><br><br>\n      </div>\n    </div>\n  </div>\n</div>\n'),HTML.DIV({"class":"chapter"},"\n  ",HTML.DIV({"class":"container"},"\n    ",HTML.DIV({"class":"row"},"\n      ",Blaze._TemplateWith(function(){return{buttonText:Spacebars.call("Beta signup")}},function(){return Spacebars.include(n.lookupTemplate("signupEmail"))}),"\n    "),"\n  "),"\n"),HTML.Raw('\n<div class="chapter">\n  <div class="container">\n    <div class="row">\n      <div class="col-sm-2">\n        <img src="/secondline/secure.jpg" class="img-responsive img-rounded" alt="Secure">\n        </div>\n      <div class="col-sm-4">\n        <h2>Secure</h2>\n        <p>All your information is encrypted in transit and on your phone, so nobody can listen in.</p>\n      </div>\n      <div class="col-sm-2">\n        <img src="/secondline/hasslefree.jpg" class="img-responsive img-rounded" alt="Hassle Free">\n        </div>\n      <div class="col-sm-4">\n        <h2>Hassle Free</h2>\n        <p>Just pick a password and you\'re ready to start talking.</p>\n      </div>\n    </div>\n    <div class="row secondline-feature-row">\n      <div class="col-sm-2">\n        <img src="/secondline/offline.jpg" class="img-responsive img-rounded" alt="Offline">\n        </div>\n      <div class="col-sm-4">\n        <h2>Offline</h2>\n        <p>Because Second Line leverages the Edgenet, that means you can talk with friends nearby even if there\'s no internet connection.</p>\n      </div>\n      <div class="col-sm-2">\n        <img src="/secondline/anonymous.jpg" class="img-responsive img-rounded" alt="Anonymous">\n        </div>\n      <div class="col-sm-4">\n        <h2>Anonymous</h2>\n        <p>Second Line uses a technique called <a href="https://en.wikipedia.org/wiki/Mix_network">mix-nets</a> so that even the phone company can’t figure out who you\'re messaging.</p>\n      </div>\n    </div>\n  </div>\n</div>\n\n<div class="chapter">\n  <div class="container">\n  <hr>\n        <div class="row">\n          <div class="col-sm-6">\n            <p class="text-left"><b>Coming July 2015 to:</b></p>\n            <img src="/secondline/googleplay.jpg" class="img-responsive img-rounded pull-left" alt="Google Play">\n          </div>\n          <div class="col-sm-6">\n            <p class="text-right"><b>Fork us on:</b></p>\n            <a href="https://github.com/gounplugged/UnpluggedDroid"><img src="/secondline/github.jpg" class="img-responsive img-rounded pull-right" alt="Github"></a>\n          </div>\n        </div>\n      </div>\n    </div>')]})}();

